import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div>
        <h2>HELLO</h2>
        <p>This is Zelda Yuan's web page.
        I have C++ and Qt creator program experience, and two years ios
        and android develop experience, and some React-Native Redux experience.
        </p>

        <p>My target job is React Native or Redux Developer</p>
      </div>
    );
  }
}

export default Home;
